import React, {Component} from 'react';
import PropTypes from 'prop-types';

//materia ui
import { withStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import Menu from '@material-ui/core/Menu';

//browser router
import {BrowserRouter as Router,NavLink, Route,Switch, Redirect, Link}from 'react-router-dom'

//components
import BookDelivery from './_components/bookDelivery'
import DashBoard from './_components/dashBoard'


const styles = {
  root: {
    flexGrow: 1,
  },
  grow: {
    flexGrow: 1,
  },
  menuButton: {
    marginLeft: -12,
    marginRight: 20,
  },
};

class App extends Component {
  state = {
    auth: true,
    anchorEl: null,
  };

  handleChange = event => {
    this.setState({ auth: event.target.checked });
  };

  handleMenu = event => {
    this.setState({ anchorEl: event.currentTarget });
  };

  handleClose = () => {
    this.setState({ anchorEl: null });
  };
  render() {
    const { classes } = this.props;
    const { auth, anchorEl } = this.state;
    const open = Boolean(anchorEl);
    return (
      <div className={classes.root}>
        <Router>
          <AppBar position="static">
            <Toolbar>
              <IconButton 
                className={classes.menuButton} 
                color="inherit" 
                aria-label="Menu"
                aria-owns={open ? 'menu-appbar' : undefined}
                aria-haspopup="true"
                onClick={this.handleMenu}>
                <MenuIcon />
              </IconButton>
              <Menu
                id="menu-appbar"
                anchorEl={anchorEl}
                anchorOrigin={{
                  vertical: 'top',
                  horizontal: 'right',
                }}
                transformOrigin={{
                  vertical: 'top',
                  horizontal: 'right',
                }}
                open={open}
                onClose={this.handleClose}
              >
                <MenuItem onClick={this.handleClose}>
                  <NavLink to="/book">Book Delivery</NavLink>
                </MenuItem>
                <MenuItem onClick={this.handleClose}>
                  <NavLink to="/history">Booking History</NavLink>
                </MenuItem>
                <MenuItem onClick={this.handleClose}>
                  <NavLink to="/account">My account</NavLink>
                </MenuItem>
              </Menu>
              <Typography variant="h6" color="inherit" className={classes.grow}>
                Ease On Delivery
              </Typography>
            </Toolbar>
          </AppBar>

            <Switch>
              <Route exact path='/' authed={this.state.authed} component={DashBoard}/>
              <Route path='/book' authed={this.state.authed} component={BookDelivery}/>
              <Route path='/history' authed={this.state.authed} component={BookDelivery}/>
              <Route path='/viewAccount' authed={this.state.authed} component={BookDelivery}/>
            </Switch>
        </Router>
      </div>
    );
  }
}

App.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(App);
